def getHead(lineStr: String): String = {
	val pa = "==+".r
	val items = pa.findAllIn(lineStr).toList
	if (items.length != 2) {
		""
	} else {
		if (items(0) != items(1)) {
			""
		} else {
			val sign = items(0)
			if (sign.length > 6) {
				""
			} else {
				val headingPa = (sign + ".*" + sign).r
				val eles = headingPa.findFirstIn(lineStr).getOrElse("")
				eles.trim
			}
		}
	}
}

def getHeads(): (String => List[String]) = { wikitext => 
	if (null == wikitext) {
		null
	} else {
		val text = wikitext.trim
		val length = text.length
		val upText = text.toUpperCase.replaceFirst(" +", " ")
		if (length < 4 || upText.startsWith("#REDIRECT[[")) {
			null
		} else {
			if (!(text contains "==")) {
				null
			} else {
				val lineLst = text.split("\n").toList
				val validLines = lineLst.filter(line => {
				    val count = line.count(_ == '=')
				    count >= 4 && count <= 12 && (line contains "==")
				})
				// lineLst
				val headings = validLines.map(line => {
					val result = getHead(line)
					result
				})
				headings.filter(_ != "")

			}
		}
	}
}

val extHeads = udf(getHeads)

