def getHeadingAndLevel(): (WrappedArray[String] => WrappedArray[(String, Int)]) = { headings => 
	if (null == headings) {
		null
	} else {
		val hdMeta = headings.map( heading => {
			val pa = "==+".r
			val equals = pa.findFirstIn(heading).getOrElse("")
			if (equals == "") {
				("", -1)
			} else {
				val level = equals.length
				val value = heading.toLowerCase.trim.stripPrefix(equals).stripSuffix(equals).trim.replaceAll(" +", " ")
				(value, level)
			}
		})

		val validHd = hdMeta.filter(x => x._2 != -1)
		validHd
	}
}

