import scala.collection.mutable.ListBuffer 

def splitByVal(lst: List[(String, Int)], splitVal: Int): List[(String, List[String])] = {
    val rst = ListBuffer[(String, List[String])]()

    val parentL = splitVal
    val childL = parentL + 1
    var hasPar = false
    var key = ""
    var value = ListBuffer[String]()
    for ((hd, le) <- lst) {
        if (hasPar) {
            if (le == parentL) {
                if (value.isEmpty) {
                    rst += ((key, null))
                } else {
                    rst += ((key, value.toList))
                }
                key = hd + "-" + (le - 1)
                value.clear
            } else { //child
                value += hd + "-" + (le - 1)
            }
        } else {
            if (le == parentL) {
                hasPar = true
                key = hd + "-" + (le - 1)
            }
        }
    }

    if (hasPar) {
        if (value.isEmpty) {
            rst += ((key, null))
        } else {
            rst += ((key, value.toList))
        }
    }

    rst.toList
}

import org.json4s._
